  selector: 'app-logout',
  templateUrl: './form-logout.component.html'
})
export class LogoutComponent{

  constructor(private dataService:AuthenticationDataService, private ruta:Router){}

  logout(event:Event){
    //event.preventDefault();
    alert("asdasd");
